function App() {
  const [token, setToken] = useState(localStorage.getItem("userToken") ?? null);

  return (
    <div className="App">
      {/* {token ? <Main.js /> : <Login token={token} setToken={setToken} />} */}
      <BrowserRouter>
        <Switch>
          <Route path="/Login">
            <Login />
          </Route>
          <Route path="/Main">
            <Dashboard />
          </Route>
        </Switch>
      </BrowserRouter>
    </div>
  );
}
export default App;
